    <script type="text/javascript">(function (diagram) { $('.chair').css("cursor", "pointer");

$('.chair').click(function () {

    var id = $(this).attr('id');
    var seat = diagram.shapes[id];
    var rects = d3.select('#' + id)
        .selectAll('rect')
        .transition()
        .duration(300);

    var info = d3.select("#seat-selection").select('text');

    if (seat.selected) {
        seat.selected = 0
        rects.style('fill', 'white');
    }
    else {
        seat.selected = 1;
        if (seat.Props.Price > 20) {
            rects.style('fill', '#f00');
        } else if (seat.Props.Price > 10) {
            rects.style('fill', '#0f0');
        } else {
            rects.style('fill', '#00f');
        }
    }

    var prices = [];
    for (var seatId in diagram.shapes) {
        var seat = diagram.shapes[seatId];
        if (seat.selected) {
            prices.push(Math.ceil(seat.Props.Price))
        }
    }
    info.text('price: ' + prices.join(' + '));
